export function getFormData() {
  return [
    {
      "uid": "name",
      "data_type": "string",
      "label": "first Name",
      "value": "harshal",
      "_metadata": {
        "required": true
      }
    },
    {
      "uid": "name1",
      "data_type": "string",
      "label": "Last Name",
      "value": "harshal",
      "_metadata": {
        "required": true
      }
    },
    {
      "uid": "age",
      "data_type": "number",
      "value": "28"
    },
    {
      "uid": "group",
      "data_type": "group",
      "value": [{
        "uid": "name",
        "data_type": "string",
        "value": "harshal"
      },
      {
        "uid": "group",
        "data_type": "group",
        "value": [{
          "uid": "name",
          "data_type": "string",
          "value": "harshal"
        },
        {
          "uid": "age",
          "data_type": "number",
          "value": "28"
        }
        ]
      },
      {
        "uid": "age",
        "data_type": "number",
        "value": "28"
      }
      ]
    }
  ];
}

export function getFormRules() {
  return [{
    "targetfielduid": "group.age",
    "opernadFieldUid": [
      "name"
    ],
    "operations": "equal",
    "withValue": "test"
  }];
}
